import React, { useState } from 'react';
import './App.css';
import Session from './Session';
function App() {
  const [curr_user, set_curr_user] = useState()
  function update_curr_user(username){
    set_curr_user(username.target.value)
    console.log(curr_user)
  }
  return(
    <div>
      <form>
        <input type="text" placeholder="User Id"/>
        <button onClick={update_curr_user}> Submit </button>
      </form>

    <Session/>
    </div>

  );
}

export default App;
